import React from 'react'
import NavbarHome from './NavbarHome';
import PrintPosts from './PrintPosts';
import './LikedPosts.css'
const LikedPosts = () => {
    const location = useL
    return (
        <>
        <NavbarHome/>
        <div className = 'ViewPosts'>
            <div className = 'Title'>
                Liked
            </div>
            <PrintPosts/>
        </div>
        </>
    )
}

export default LikedPosts;
